INSERT INTO `products` VALUES (58,'Vans Unisex Old Skool Skateboarding Shoes','Product Dimensions: 11 x 4 x 7 inches\r\nShipping Weight: 3 pounds (View shipping rates and policies)\r\nASIN: B01E4JSWKC\r\nItem model number: VN0A4BV5 T61\r\nDate first listed on Amazon: April 11, 2016\r\nAmazon Best Sellers Rank: #57,326 in Clothing, Shoes & Jewelry (See Top 100 in Clothing, Shoes & Jewelry)',189.96,'qGeSE5sBLZ1r0GsxEp3LXEvE.jpg','Available','5'),(59,'Pimp Adult Costume Shoes Silver - Large','Package Dimensions: 14.3 x 12.1 x 5.3 inches\r\nShipping Weight: 3.85 pounds (View shipping rates and policies)\r\nASIN: B008YV08S6\r\nDate first listed on Amazon: July 2, 2014\r\nAmazon Best Sellers Rank: #1,173,980 in Clothing, Shoes & Jewelry (See Top 100 in Clothing, Shoes & Jewelry)',69.00,'j__m5px9v8f-S0vbkWu4x9c9.jpg','Available','3'),(64,'TICCOON Work Steel Toe Shoes Safety Shoes for Men and Women Lightweight Industrial & Construction','Rubber sole\r\nfabric\r\nRubber sole clear texture design, stable grip on the ground, and non-slip and wear-resistant.\r\nThe work shoes are made from flyknit uppers, keeping the feet fresh and comfortable to wear.\r\nThe work safety shoes have a fashion style. The lightweight shoes are more comfortable to wear. Let you not feel heavy after fatigue work.\r\nGreat for those working on electric power industry, auto manufacturing, construction and machine manufacturing. In addition, they are perfect for mountain climbing and outdoor trekking.',45.00,'G-SQE_yV2LBmRTyC8JBX6s5q.jpg','Available','5'),(69,'Boku No Hero Academia My Hero Academia Shoes Canvas Sneakers','Made of high quality canvas and anti-slip rubber sole, and constructed from breathable fabrics and a padded insole ,you will feel comfy and not tired even walking hours outside.\r\nPadded sole is very comfortable and soft for all day wear, and the washable material is easy to clear, with adjustable shoes laces are flexible both for wide and narrow foot.\r\nDelicate print and solid color make it an classic and eye-catching sneakers, which are timeless style and back to school gift and a great gift for My Hero Academia fans.\r\nGreat for many occasions such as: casual wear in house or in school, hiking, running, shopping, driving, and gym etc. Suitable for all seasons and well paired with any kind of clothes.\r\nFRIENDLY REMINDER : please measure your foot length and compared with our size chart in the picture carefully before you buy in order to get a pair of perfect sneakers for yourself.',42.99,'ctmsjVlbq0P2YeIXbqTewDXK.jpg','Available','5'),(70,'Forever Link Women\'s REMY-18 Glitter Fashion Sneakers','Made of high quality canvas and anti-slip rubber sole, and constructed from breathable fabrics and a padded insole ,you will feel comfy and not tired even walking hours outside.\r\nPadded sole is very comfortable and soft for all day wear, and the washable material is easy to clear, with adjustable shoes laces are flexible both for wide and narrow foot.\r\nDelicate print and solid color make it an classic and eye-catching sneakers, which are timeless style and back to school gift and a great gift for My Hero Academia fans.\r\nGreat for many occasions such as: casual wear in house or in school, hiking, running, shopping, driving, and gym etc. Suitable for all seasons and well paired with any kind of clothes.\r\nFRIENDLY REMINDER : please measure your foot length and compared with our size chart in the picture carefully before you buy in order to get a pair of perfect sneakers for yourself.',39.99,'HUPCwTpNxzXYuFQdxaL7kX0L.jpg','Available','5'),(71,'Video Maker','Sold by:Amazon.com Services LLC\r\nAvailable instantly\r\nThis app needs permission to access:\r\n\r\nAccess the flashlight\r\nAccess the list of accounts in the Accounts Service',100.00,'Yn3S76OTd4xgMhgOYnVItdM0.jpg','Available','2'),(72,'Vimo- Video + Motion Sticker and Text','Sold by:Amazon.com Services LLC\r\nAvailable instantly\r\nThis app needs permission to access:\r\n\r\nAccess the flashlight\r\nOpen network sockets',45.00,'N_85Ph2muj-MArQ-Gfn4MSUa.jpg','Available','5'),(73,'Canon EOS M50 Mirrorless Vlogging Camera Kit with EF-M 15-45mm lens, Black','Due to increased demand, we temporarily have reduced product selection available for delivery to your region. We are working to improve selection availability as soon as possible.',450.00,'SzRLvtk1bM3_RH8dKS0g8_3d.png','Available','5'),(74,'Kodak PIXPRO Friendly Zoom Digital Camera with 5X Optical Zoom and 2.7\" LCD Screen (Black)','5x optical zoom\r\n28mm wide angle\r\n16 megapixels\r\n2.7\" Lcd screen\r\n720P HD video',49.00,'YKxH9Q9FgpLlhVNs6YDT3KiC.png','Available','5'),(75,'Fujifilm X-T30 Mirrorless Digital Camera, Charcoal Silver (Body Only)','Advanced Image Sensor Technology: The 26.1MP BSI APS-C X-Trans CMOS 4 image sensor and X-Processor 4 quad-core CPU combination provide accurate AF and Face Detection for moving subjects when capturing either high-resolution stills or recording 4K video.\r\nAccurate Auto-Focus Tracking and Face Detection: he new X-Processor 4 Quad Core-CPU offers fast and accurate face-detection for moving people. Additionally, eye-detection AF now works in AF-C mode, which results in accurate focus-tracking for moving portrait subjects. The low-light limit for phase detection AF has been expanded even more from the conventional +0.5EV to -3EV, to allow for operation in a wide range of lighting scenarios.\r\nSuperior Video and Image Effects: The X-T30 offers the ability to record 4K video at 30 frames per second or capture of 120 frames per second at 1080p to create super slow motion effects. Filmmakers needing extreme color fidelity can record 10-bit, 4:2:2 color through the camera’s HDMI port.\r\nIntuitive Design with Comfortable Controls: Offers 3.0-inch touch LCD with 2-way tilting and improved touch screen to capture images efficiently in challenging situations. Provides advanced SR Auto mode - easily activated with a lever - to automatically choose the optimum shooting settings for a given scene out of 58 presets.\r\nNext-Gen Wireless Connectivity: Built-in Wi-Fi and Bluetooth V.4.2 offers digital communication with the free FUJIFILM Camera Remote app to wirelessly control the camera or share images to smart devices.\r\nVideo Capture Resolution: 4K Dci 2160P',29.00,'QHtcqpQI1IJqtc8MFPcKd-hD.jpg','Available','5'),(76,'Samsung Galaxy A20S w/Triple Cameras (32GB, 3GB RAM) 6.5\" Display, Snapdragon 450','International Model - No Warranty in US. Compatible with Most GSM Carriers like T-Mobile, AT&T, MetroPCS, etc. Will NOT work with CDMA Carriers Such as Verizon, Sprint, Boost\r\nRAM 3GB , ROM 32GB Internal Memory ; MicroSD (Up to 512GB), Android 9.0 (Pie), Qualcomm SDM450 Snapdragon 450 (14 nm), Octa-core 1.8 GHz Cortex-A53, Adreno 506\r\nMain Rear Camera: 13.0 MP + 8.0 MP + 5.0 MP , F1.8 , F2.2 , F2.2 ; Front Camera: 8.0 MP , F2.0, Non-removable Li-Po 4000 mAh battery\r\n3G HSDPA 850 / 900 / 1700(AWS) / 1900 / 2100, 4G LTE band 1(2100), 2(1900), 3(1800), 5(850), 7(2600), 8(900), 20(800), 28(700), 34(2000), 38(2600), 39(1900), 40(2300), 41(2500)\r\n6.5 inches, 103.7 cm2 (~81.9% screen-to-body ratio) 720 x 1560 pixels (HD+), 19.5:9 ratio (~264 ppi density) IPS LCD capacitive touchscreen, 16M colors',129.00,'EdtksfA7MvYeVwkFtV4TA3uG.jpg','Available','5'),(77,'Samsung Galaxy S10 S-View Flip Case, Black','Notification Alerts - It\'s simple to answer calls, control your music, and more—all without opening the cover. Tap and swipe as needed, and even read important information like time, date, weather, and battery level.\r\nPocket Screen Protection - Guard the back of your phone, while the attached flap covers the front to help prevent screen scratches when it\'s in your bag or pocket.\r\nUltra-Slim - Shield your phone from all sides with this shell-type design that still easily fits in your pockets and hand.\r\nUS Version: Comes with Quick Start Guide, and 1 Year Product Warranty (information on the retail package)',300.00,'bmdXmbygjDk7mx6Yy29TOeSb.jpg','Available','5'),(78,'Samsung Galaxy S9 G960U 64GB Unlocked GSM 4G LTE Phone w/ 12MP Camera - Midnight Black','Super Speed Dual Pixel Camera; Music Play Time: AOD off: Up to 90 hours, AOD on: Up to 51 hours\r\nInfinity Display: edge to edge immersive screen, enhancing your entertainment experience\r\nIP68 rating: withstands splashes, spills, and rain so it can take a dip, worry free\r\nBattery: AOD off: Up to 326 hours (13.6 days), AOD on: Up to 82 hours (3.5 days)\r\nBluetooth v5.0 (LE up to 2 Mbps)',150.00,'4pNRfsrnGkMbShqec0I3HIp5.jpg','Available','5'),(79,'100% Natural Pure Gum Spirits of Turpentine in 8 Oz Bottle Glass','100% Pure and All-Natural\r\nMade in the USA\r\nHand Bottled and Packaged\r\nORDER TODAY - WE SHIP TOMORROW!\r\nFresh, Clean Scent of Pine!',15.00,'D9oax4w_Cc9gVE373mEQeU5X.jpg','Available','3'),(80,'Cashew Coconut Crunch Baked Granola','Creamy fresh ground organic cashew butter is decadent. When used in this granola the taste is smooth and elegant, yet not too sweet. In our granola, crunch means crunch. It’s in there!\r\nIngredients: gluten-free rolled oats, *maple syrup, *cashew butter, gluten-free quick oats, *dried coconut, *cashews, *puffed quinoa, *ground flaxseed, *coconut oil, vanilla flavor, *maple sugar, Himalayan crystal salt, *cinnamon. *Organic\r\nEverything we make is hand-made daily in our dedicated gluten-free facilities. Our products are free of gluten, dairy, soy, artificial flavors, colors & preservatives. We use the best ingredients available, locally sourced wherever possible. All nuts & seeds are soaked & sprouted.',5.00,'a1jWR3opYeFrJSUlX67j-B02.jpg','Available','4'),(81,'Loudwolf Potassium Chloride/Fine Powder / 4 Ounces / 99% Pure Food Grade/Ships Fast from USA','TOTAL WEIGHT OF PRODUCT: 4 Ounces\r\nNUMBER OF BOTTLE(S): 1 Plastic Bottle\r\nTEXTURE: Fine Powder\r\nGRADE: 99% Pure Food / Reagent Grade\r\nCAS #: 7447-40-7',85.00,'ZDwT4HCrpmBnZOLiMlHPa64d.jpg','Available','5'),(82,'Odoria 1:12 Miniature Food Donut Box Dollhouse Kitchen Accessories','Scale: 1:12 Dollhouse Kitchen Miniature\r\nIncluding: 1x Donut Box (Not Including Other Items)\r\nApprox. Size (LxWxH): 1.3x0.9x0.4 inch\r\nHigh Details and Workmanship: For Dollhouse Decor of Kitchen, Diningroom, Livingromm, Restaurant, Bar etc.\r\nThe items are glued together.',185.00,'M5JWtmwKSU64mhQT1aDKc1en.jpg','Available','5'),(83,'iClever Boostcare Kids Headphones Girls - Cat Ear Hello Kitty Wired Headphones','THE SAFEST OPTION - iClever Boostcare kids headphones are generously recommended to protect vulnerable and sensitive ears with adjustable 85dB/94dB volume limiting. Study mode or travel mode, choose one you like. Built-in Microphone is another bonus. Hands-free call, no problem.\r\nADJUSTABLE HEADBAND WITH UNIMAGINABLE TOUGHNESS - iClever toddler headphones survive the hard treatment of little kids. The headband is twistable and also easy to adjust. It is flexible to accommodate a wide range of head sizes. Soft earmuffs deliver comfortable feelling while listening. There is very little clamping pressure.\r\nSTART FROM HEALTH - iClever headphone for kids adopts high quality food grade materials. Namely, it is made of nontoxic materials and designed to withstand the environment of intended use. Therefore, we always maintain the desired nature and credible production of quality. All of these can be traced to be the health of kids. It won\'t cause any negative effect to your kids even with long time wearing and touching.\r\nPLAYFUL CAT-INSPIRED DESIGN - Combining high quality audio with unique fashion, iClever children headphones are finished with two cat ears on the top of the band. No matter your kids are a cat person or not, they are cute beyond doubt. And the impressive shape will catch the fancy of them, especially for those who is obsessed about the cat. Cat-related headphones will fulfill every girlish dream and fancy.\r\nUNIVERSAL COMPATIBILITY & SATISFYING SERVICE - With the standard 3.5mm headphone jack, works with virtually all smartphones, tablets, such as Apple iPhone, iPad Mini, Samsung Galaxy Phones, Lenovo, Android Cellphones,Tablets and more. You are entitled to enjoy 18-month replacement warranty and 24-hour Customer-friendly Support Service. Any questions please feel hassle-free to contact us.',285.00,'KvRJWte6N1RoQfRzTN1-Kalb.jpg','Available','5'),(84,'Little Tikes First Slide (Red/Blue) - Indoor / Outdoor Toddler Toy','Perfect beginner\'s slide, sized especially for younger kids (3-feet long)\r\nFolds down without tools for compact storage and moving\r\nProduct Size: 23.00\'\'L x 18.00\'\'W x 39.00\'\'H and Slide length: 38.00\'\'L.Handrails snap into place\r\nKids can use the slide inside or outside. Age- 18 months - 6 years\r\nMade in USA.Note:Push down on the item handle until an audible click is heard to ensure the handles are secure.',32.00,'kCtlcq004VXWQkvVGyic2k4o.jpg','Available','5'),(85,'Toddleroo by North States Superyard Colorplay 8 Panel Baby Play Yard: Safe play area anywhere.','NEW NAME - SAME GREAT BRAND YOU TRUST: Designed for both indoor and outdoor use, the Toddleroo by North States Superyard Colorplay is an excellent solution for creating a safe playpen for your child. Plus, the convenient Folding ABC Play Mat (sold separately) works great with this play yard. It provides extra comfort and sensory stimulation during tummy time or any time!\r\nSAFETY & CONVENIENCE: This play yard sets up and folds up quickly. Comes complete with carrying strap and non-slip pads. Fun for your child, peace of mind for you! Plus, the durable plastic is kid-tough and difficult for either pets or children to climb.\r\nVERSATILE: This durable plastic eight-panel colorful play yard creates up to 34.4 square feet of protected play space.\r\nEXTRA-WIDE BARRIER: Using a maximum of 6 panels, the play yard can now act as an extra-wide safety barrier with the use of the \"Superyard Wall Mount Kit\" (sold separately). It\'s the perfect solution for homes with open floor plans or large spaces that need blocking off. Fits openings from 38 1/2 inches to over 16 feet wide.\r\nBABY SAFE: Safe for babies ages 6-24 months. Proudly made in the USA.',322.00,'hZ23iI6lcKQGwqgVNFrVKXy3.jpg','Available','5'),(86,'Baby phone toy - kids learning game','This app needs permission to access:\r\n\r\nOpen network sockets\r\nAccess information about networks',322.00,'TJZjJ0z8fZdkg0jsUhEuHP6S.jpg','Available','3'),(87,'Basde Telescope Binocular Lens Educational Toys, Outdoor Games, Camping Gear','♥Advanced Design: Non-slip scratch, the grip has been ergonomically patented designed to fit the hands of children. It is easy to focus, and they can adjust to adult eyes just as well as kid-sized eyes. The leaves of a tree 100 yards away came into sharp focus.\r\n♥Durable binoculars that can withstand drops and falls on floors due to rubber coating that absorbs shock. If accidentally dropped on the ground, the binoculars are protected from damage with shock proof rubber armor. Other brands do not have this safety feature!\r\n♥Crystal Clear View: The FMC prism green coated optics system can control optical reflection to create crisp and colorful images. The product ensures the user can see the entire visual field for capturing objects easily with 7.2° viewing angle. Multi-layer broadband coating technology, make you see the scene more realistic.\r\n♥Real Binoculars for Kids: This product has a super magnification of 8X with an amazing view. The binoculars can be adjusted to easily match the eye distance gap for each child. Great for bird watching, learning, hunting, theaters, boat rides, hiking, traveling and enjoying the wilderness!\r\n♥WARRANTY - We really care about the quality of our products and service, so If you aren’t satisfied with our binoculars, please return it and get a hassle-free refund!',32.00,'QKohxGKlOmMeSDwYcT-fDn6q.jpg','Available','4'),(88,'Copay Check in Sign - Black with Laser Engraved Silver Text (9x5)','Size: 9\" x 5\"\r\nMaterial: acrylic\r\nColor: black with laser engraved matte silver text\r\nRounded Corners (5/16\"); Thickness 1/16\"\r\nStandard check in text included (as shown in photo)',321.00,'pbTvOTdYjmNeUCv5cgjYi2LV.jpg','Available','4'),(89,'Commercial Office Cleaning','What\'s included with Office Cleaning?\r\nDusting, mopping, and vaccuming of office space\r\nTrash removal to outdoor cans\r\nOffice kitchen (if available): counters, floor, microwave\r\nBathrooms: toilets, sinks, floor\r\nProvider will bring cleaning supplies. Window washing is not included\r\nBuilding access required\r\nCustomer must be present during entire appointment',123.00,'tHmKnO0SUCgZPkF1U8uNyyWD.jpg','Available','4'),(90,'Office Chair Assembly','What\'s included with Office Cleaning?\r\nDusting, mopping, and vaccuming of office space\r\nTrash removal to outdoor cans\r\nOffice kitchen (if available): counters, floor, microwave\r\nBathrooms: toilets, sinks, floor\r\nProvider will bring cleaning supplies. Window washing is not included\r\nBuilding access required\r\nCustomer must be present during entire appointment',123.00,'5ia0ZQMEtfP6ay8I2reBNS_t.jpg','Available','4'),(91,'Dr. Fremont\'s Stainless Steel Pet ID Tag Custom for Dog Cat Personalized','Premium Quality, Stainless Steel Custom Tags for Dogs or Cats\r\nFree Personalization\r\nIncludes Split Ring for Attaching to Collar\r\nStronger than Anodized Aluminum Dog or Cat Tags\r\nMade in the USA',123.00,'UCh3VDUGeTfuOkz5YCl5dAsL.jpg','Available','4'),(92,'zeze Cat House Rattan Knitting Four Seasons Universal cat House ','cat bed\r\ncat tree\r\nThe cane makes up the design\r\nThe four seasons general\r\n',200.00,'s5VrA3v1Q3FA6HQNnXvSSOUf.jpg','Available','5'),(93,'Magic Gate, Portable Folding Magic Gate for Dogs Pet Safety Gate, 70.9\"x28.3\" Mesh','High Quality And Durable:Our pet gate made of upgraded thick nylon cloth and stainless steel Stretchable Poles, which is resistant to biting and is not easy to be torn by dogs, which is durable.\r\nMagic Safety Enclosure: Magic Gate works as baby safe gate and pet gate to providing a safe enclosure to play and rest. suitable for place at anywhere in house from doorways, between walls, stairs, bedroom, kitchen, dining or even way outside.\r\nEasy To Install: No tools required to set up,When not in use you can easily fold it and store anywhere you want it also takes almost no space.Lightweight and portable to meet all your on-the-go needs.Give away 4 PCS ABS Adhesive Hooks.\r\nMagic gate will take care of your pets:This magic gate will help you put your pets where you want them to stay. Worry no more for their safety and security, you can now keep them from going outside the house. You can also create a private space for them when you have visitors around.\r\nThe Suitable Size: This gate is 28.3 inches/ 72 cm tall and expands to 70.9 inches/ 180cm wide (Note: please measure the size of your door before buying), suitable for most ordinary family doors. Pet safety enclosure perfect for doorways, between walls, or stairwells, indoors and outdoors',111.00,'uws1NwI5DJ6x8H0VEUAf85Id.jpg','Available','5'),(94,'Electriduct Pack of 6 Pair of Plastic Parking Mat Guides for Garage','Fits all cars, trucks and SUVs | Order for 6 Parking Mats | Color: Yellow\r\nIts design provides the driver with an accurate stopping point to position the vehicle in the right spot\r\nHelps park your car without going too far | Prevents damage to the vehicle and surrounding items.\r\nAdhesive tape strips pre-applied keep it in place\r\nReflective strip to increase visibility',12.00,'azAAelloc7IFgZrmWns1Jkt5.jpg','Available','3'),(95,'Crushproof FLT300 Flarelock Exhaust Hose 11 Foot X 3 Inch','Crushproof 3\" x 11\' Flarelock Hose\r\nNo wire helix - Crushproof so even the heaviest vehicles won\'t smash it\r\nHas male and female end so two hoses can be connected to make a longer length\r\nMore heat resistant and flexible than standard hoses up to 600 degrees F\r\nHose has a 5/32\" thickness',12.00,'oKtprfe1ZKzlLpfghyi6sALz.jpg','Available','4'),(96,'APlusLift HW-10KBP 10,000LB Two Post Floor Plate Auto Hoist Car Lift','Shipping from nearest warehouses to minimize possible freight damages (Tacoma, WA; Dallas, TX; Atlanta, GA; Indianapolis, IN; Allentown, PA)\r\nCombo (Symmetrical and Asymmetrical) Arm Assembly with Screw-in Pads!\r\nCE Certified Lift Structure and Hydraulic System; 6\'9\" Lift Height Maximum with Truck Adapters\r\nDurable Powder Coated Finish on Steel; All Robot Welded Structure\r\nStrong Double \"S\" Column Design; Carriage Material Q355 Stronger Than Normal Q235 Steel',123.00,'9RPjIcRmfqr8heza2ObYTYfX.jpg','Available','4'),(97,'Ebros Gift Cast Iron Small Whimsical Flying Pig Angel Decorative Collectible Statue','Each Hog Heavens Flying Pig Sculpture measures 2.5\" Tall, 3.5\" Wide and 2 \" deep approximately. It weighs about 13 ounces.\r\nEach Hog Heavens Flying Pig Sculpture is made of solid heirloom cast iron, hand painted and polished in rusted bronze finish.\r\nAn adorable babe pig has an angelic side to it, one that gives it two angel wings to give it flight. Cows may jump over the moon but pigs fly above the moon in this whimsical fairy tale. This adorable pig was sculpted with great character and details making it a presentable sculpture for decorative and functional purposes.\r\nWhen pigs fly, your papers won\'t! This adorable flying pig paperweight made of cast iron will make sure your papers stay in place and with a whimsical flair. This fun collectible desk accessory comes in a dark rusted bronze finish to match any decor, especially industrial and rustic. Makes a great addition to any office, home, cabin, lodge or what have you!\r\nThis is an Ebros exclusive collection. This listing is for six flying pig sculptures.',100.00,'OPiIskaopDwhEND0PaLw04x3.jpg','Available','5'),(98,'Vintage Policeman Riding Motorcycle Clockwork Tin Toy Collectible Gift with Wind-Up Key','A vintage policeman on a motorcycle model wind up clockwork tin toy\r\nWind it up clockwise with a key, the motorcycle will rush away\r\nA perfect collectible gift or decoration for kids and adults\r\nSize (LxWxH): Approx. 14.5 x 4 x 11 cm / 5.71 x 1.57 x 4.33 inch\r\nMaterial: Tin',24.00,'ZB3U6FxnOwAMmhTiGaIZo1p1.jpg','Available','5'),(99,'1923 Ford Model TT Coca Cola Pickup Truck with 9 Coca Cola Cases and a Hand Cart 1/32 Diecast','Detailed interior, exterior and engine compartment\r\nHas opening hood, doors and rear gate, steerable wheels and rubber tires\r\n1:32 scale diecast model car\r\nDimensions are approximately L-6, W-2.25, H-2.5 inches\r\nMade of diecast metal with some plastic parts',243.00,'qzuWxxZmpztKT04AcDbOPV0y.jpg','Available','4');
